import { Button, Dialog, DialogContent, DialogContentText, DialogTitle, TextField, Typography, CardMedia, DialogActions } from "@mui/material";
import { Box } from "@mui/system";
import { useState } from "react";
import { useNavigate } from "react-router";

export default function  CryptoBlock(props) {
  const navigate = useNavigate();
  const [open, setOpen] = useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleChange = (e) => {
   navigate("/?amount={e.target.value}&name={props.name}")
  }

  return (
    <>
      <Box sx={{display: 'flex', flexDirection: 'row'}}>
      <CardMedia
        component="img"
        height="50"
        width="50"
        image="#"
        alt={props.name}
      />
     <Typography> {props.name}</Typography>


     <Button variant="outlined" onClick={handleClickOpen} >Buy</Button>


     <Dialog open={open} onClose={handleClose}>
        <DialogTitle>{props.name}</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Amount"
            type="number"
            fullWidth
            variant="standard"
            onChange={handleChange}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleClose}>Buy</Button>
        </DialogActions>
      </Dialog>
      </Box>
    </>
  )
};
